import React from 'react'
import "./styles.scss"
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';

export default function Work() {

    const itemData = [
        {
            id: 1,
            title: "Hello World",
            description: "Lorem Ipsum 1",
            // icon: ''
        },
        {
            id: 2,
            title: "Hello World 2",
            description: "Lorem Ipsum 3",
            // icon: ''
        },
        {
            id: 3,
            title: "Hello World 3",
            description: "Lorem Ipsum 3",
            // icon: ''
        },
    ]
    return (
        <div className='work' id='work'>
            <h3>Works</h3>


            <div className="wrapper">

                <div className="left">
                    <div className='arrowLeft'>
                        <ArrowForwardIosIcon />
                    </div>
                    <div className="item">
                        <img src="assets/bg.png" alt="icon" />
                        <h3>Title</h3>
                        <span>Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate ducimus non repellat earum debitis provident </span>
                        <a href="#">Projects</a>
                    </div>
                </div>
                <div className="right">
                    <img src="assets/bg.png" alt="background" />


                    <div className='arrowRight'>
                        <ArrowForwardIosIcon />
                    </div>
                </div>

            </div>
        </div>

    )
}
